import s from './Post.module.css'
const Post = () =>{
    return (
        <div>
            <div className={s.user_photo}>
                <img
                    src="https://doctor-veterinar.ru/media/k2/items/cache/675d28c04794e3c683f4419536c4c15f_L.jpg"
                    alt=""/></div>
            <div className={s.active}>My posts</div>
            <div>New posts</div>
            <div>postssss</div>
            <div>posts1</div>
        </div>
    );
}
export default Post;
